ds4 = DiveSite.create(name: "Shark Caves", country: "Aruba", rating: 4, avg_depth: 0, diver_skill_level: "unknown", image_url: "https://user-images.githubusercontent.com/106715328/191394154-d1514802-0e37-456e-8f4e-bbab70380cb0.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191392919-89cf69e2-b2af-45b6-afb9-5d7ae2ddac4e.jpg", description: "At the Shark Caves you can get very close to sleeping nurse and sand sharks.")
ds5 = DiveSite.create(name: "Punta Basora", country: "Aruba", rating: 5, avg_depth: 0, diver_skill_level: "unknown", image_url: "https://user-images.githubusercontent.com/106715328/191394153-7edaf6e5-3e4e-444a-907d-7db059ae3036.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191392919-89cf69e2-b2af-45b6-afb9-5d7ae2ddac4e.jpg", description: "Punta Basora is the easternmost point of Aruba, from which a narrow reef stretches far out into the sea.")
ds6 = DiveSite.create(name: "The Boot", country: "Barbados", rating: 4, avg_depth: 18, diver_skill_level: "Intermediate", image_url: "https://user-images.githubusercontent.com/106715328/191399647-15f1b4de-2a88-4705-9097-134eebe73346.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191394475-c6efe9e6-420b-49ec-b0d2-a32fbfbbf5a4.jpg", description:"This reef combines the best of two diving worlds, reef and ship wreck. The reef itself is vibrant with excellent coral cover. Sponges and corals also coat the wreckage. Note: the ship wreck is for only experienced divers.")
ds7 = DiveSite.create(name: "Carlisle Bay", country: "Barbados", rating: 4, avg_depth: 8, diver_skill_level: "Intermediate" , image_url: "https://user-images.githubusercontent.com/106715328/191399651-9fb640d9-9b14-4855-9e79-1d6876878aec.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191394475-c6efe9e6-420b-49ec-b0d2-a32fbfbbf5a4.jpg", description:"Carlisle is home to six sunken vessels. A marine park, the sheltered bay offers the ideal place for beginner divers to start exploring Barbados wreck diving sites.")
ds8 = DiveSite.create(name: "Cement Plant Pier", country: "Barbados", rating: 4, avg_depth: 8, diver_skill_level: "Intermediate", image_url: "https://user-images.githubusercontent.com/106715328/191399652-018ba72a-a721-4334-8b84-1dcb0840764b.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191394475-c6efe9e6-420b-49ec-b0d2-a32fbfbbf5a4.jpg", description:"Located on the north coast, the piers chunky columns provide homes to a wide variety of marine life. The site is also accessible from both shore or a boat.")
ds9 = DiveSite.create(name: "SS Stavronikita", country: "Barbados", rating: 4, avg_depth: 22, diver_skill_level: "Novice", image_url: "https://user-images.githubusercontent.com/106715328/191399653-953c25fc-799b-4669-a704-91ff16c97c1f.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191394475-c6efe9e6-420b-49ec-b0d2-a32fbfbbf5a4.jpg", description: "Considered by many to be the best wreck dive in Barbados, the SS Stavronikita has been resting upright between 35 and 9 meters. The Greek freighter caught on fire in the early 70s and after being rescued, finally sunk in Barbados tropical waters.")
ds10 = DiveSite.create(name: "Barracuda Junction", country: "Barbados", rating: 3, avg_depth: 21, diver_skill_level: "Advanced", image_url: "https://user-images.githubusercontent.com/106715328/191399654-5217d9b3-4e82-4e52-b264-91d3df674bf2.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191394475-c6efe9e6-420b-49ec-b0d2-a32fbfbbf5a4.jpg", description: "Called Barracuda Junction because of the large schools of barracuda who prowl the lengths and depths looking for a meal, this Barbados reef provides a home to plenty of fish.")
ds11 = DiveSite.create(name: "Victor's Reef", country: "Barbados", rating: 4, avg_depth: 15, diver_skill_level: "Novice", image_url: "https://user-images.githubusercontent.com/106715328/191399655-49790d58-cd7b-4f5b-b43c-b402a439d762.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191394475-c6efe9e6-420b-49ec-b0d2-a32fbfbbf5a4.jpg", description:"Off Fitts Village on the west coast and located near the SS Stavronikita, is one of the lesser-visited dive sites around the island. It eatures a combination of both soft and hard corals, making it quite different from other reefs in the area. ")
ds12 = DiveSite.create(name: "Johnsons Reef", country: "Barbados", rating: 5, avg_depth: 22, diver_skill_level: "Advanced", image_url: "https://user-images.githubusercontent.com/106715328/191399655-49790d58-cd7b-4f5b-b43c-b402a439d762.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191394475-c6efe9e6-420b-49ec-b0d2-a32fbfbbf5a4.jpg", description: "An abundance of marine life makes Johnsons one of the most popular dives in Barbados. Stunning soft corals and huge tube and barrel sponges are a haven for small critters; macro photographers should definitely bring their cameras.")
ds13 = DiveSite.create(name: "The Larington", country: "Bermuda", rating: 3, avg_depth: 10, diver_skill_level: "Intermediate", image_url: "https://user-images.githubusercontent.com/106715328/191404852-a2767ed8-0468-490a-adbd-5921869b64b0.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191402683-c60f5a31-7ea9-4949-ae73-84ccdb5a9de8.jpg", description: "The Lartington was an early vintage freighter that crashed into Bermudas reefs on December 14th 1879.")
ds14 = DiveSite.create(name: "The Constellation", country: "Bermuda", rating: 4, avg_depth: 8, diver_skill_level: "Intermediate", image_url: "https://user-images.githubusercontent.com/106715328/191404854-3deff333-4464-4f46-a4f5-e3afaa425064.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191402683-c60f5a31-7ea9-4949-ae73-84ccdb5a9de8.jpg", description: "The wreck lies in 30 feet of water, with the top of the cement pile being about 8 feet below the surface. Visibility tends to be quite good here.")
ds15 = DiveSite.create(name: "The Cathedral", country: "Bermuda", rating: 4, avg_depth: 10, diver_skill_level: "Advanced", image_url: "https://user-images.githubusercontent.com/106715328/191404858-f1894626-a8cb-4840-8036-c96fdce6b190.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191402683-c60f5a31-7ea9-4949-ae73-84ccdb5a9de8.jpg", description: "Depths vary from the shallows in shore of the breaker wall at 15ft. to around 55ft. on the ocean side of The Cathedral. Navigation is difficult. It is very easy to get 'turned around' in the many canyons and caverns although the actual area of the site is quiet compact, care must be taken to not head off in the wrong direction.")
ds16 = DiveSite.create(name: "Three Sisters", country: "Bermuda", rating: 5, avg_depth: 10, diver_skill_level: "Advanced", image_url: "https://user-images.githubusercontent.com/106715328/191404859-2ec6f872-acc6-498b-9011-7ce6792fcd6e.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191402683-c60f5a31-7ea9-4949-ae73-84ccdb5a9de8.jpg", description: "With an average depth of 28ft and typical visibility in excess of 100ft. An excellent shallow dive for the experienced diver and novice alike. The shallow depth and the variety of fish life make it a great place for snorkelers too.")
ds17 = DiveSite.create(name: "Coco Cay (Private)", country: "Bahamas", rating: 5, avg_depth: 10, diver_skill_level: "Novice", image_url: "https://user-images.githubusercontent.com/106715328/191535646-e99b2f31-cea0-44ff-8693-a6119dc7a810.PNG", country_flag:"https://user-images.githubusercontent.com/106715328/191405069-8503f248-e82d-457f-98e4-4022d2164652.jpg", description: "This dive site is on the private island owned by the Royal Caribbean cruise line. Many great widllife can be found here. Sites accessible from both shore and boat.")
ds18 = DiveSite.create(name: "Runway Wall", country: "Bahamas", rating: 3, avg_depth: 11, diver_skill_level: "Novice", image_url: "https://user-images.githubusercontent.com/106715328/191535658-39ba54b1-014a-4463-a3e2-24e7307c977d.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191405069-8503f248-e82d-457f-98e4-4022d2164652.jpg", description: "This shallow dive site features an expansive area covered with many wrecks, dramatic reef walls, and healthy coral reefs. The dive site is on a sandy bottom at around 11 meters in depth making it easily accessible by any level of diver.")
ds19 = DiveSite.create(name: "Shark Rodeo", country: "Bahamas", rating: 4, avg_depth: 18, diver_skill_level: "Advanced", image_url: "https://user-images.githubusercontent.com/106715328/191535661-d517c70a-c093-44fd-9949-23c8ae03e615.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191405069-8503f248-e82d-457f-98e4-4022d2164652.jpg", description: "Potentially the most famous dive site in the Bahamas is located off Walkers Cay on the northernmost Island in the Bahamas. It is an area where many sharks gather and allows divers to see them in their natural habitats.")
ds20 = DiveSite.create(name: "James Bond Wrecks", country: "Bahamas", rating: 5, avg_depth: 18, diver_skill_level: "Novice", image_url: "https://user-images.githubusercontent.com/106715328/191535642-0dd53ca4-8568-48d8-9c57-83a6fbaeee1e.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191405069-8503f248-e82d-457f-98e4-4022d2164652.jpg", description: "This area is where various James Bond films such as 'Thunderball' and 'Never Say Never Again' were filmed. The water is clear and practically currentless which is why it was so valued in the films. This area features an abundance of fish and coral which allows photographers the ability to take great photos.")
ds21 = DiveSite.create(name: "Victory Reef", country: "Bahamas", rating: 5, avg_depth: 18, diver_skill_level: "Novice", image_url: "https://user-images.githubusercontent.com/106715328/191535663-cef698d6-5774-4fdb-b5e9-2ca55492b2bc.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191405069-8503f248-e82d-457f-98e4-4022d2164652.jpg", description: "Victory reef is located south of Bimini on a 7km stretch of reef with many dive spots ranging from an easy 9 to a slightly more advanced 24m of depth. Ideal for beginner divers or more experienced divers.")
ds22 = DiveSite.create(name: "Cocos Islands", country: "Costa Rica", rating: 4, avg_depth: 20, diver_skill_level: "Advanced", image_url: "https://user-images.githubusercontent.com/106715328/191581609-c6acb62b-7ec2-47df-8261-c7b5d7ed7a8f.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191536472-d34df440-87f0-4400-acd4-67340c0dde1c.jpg", description: "One of the most famous dive sites in Costa Rica, you can dive down between 10-30 meters where you will various species of sharks such as hammerheads, silky sharks, reef sharks, and tiger sharks.")
ds23 = DiveSite.create(name: "Cano Island", country: "Costa Rica", rating: 5, avg_depth: 20, diver_skill_level: "Advanced", image_url: "https://user-images.githubusercontent.com/106715328/191581693-653c1b6e-3dc6-471c-ab0d-0cfa42cab3da.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191536472-d34df440-87f0-4400-acd4-67340c0dde1c.jpg", description: "This site includes many archways, swim throughs, outcrops, and many healthy reefs. Colorful fish and other species of turtles, eels, and reef sharks.")
ds24 = DiveSite.create(name: "Atlantic Princess", country: "Dominican Republic", rating: 5, avg_depth: 15, diver_skill_level: "Novice", image_url: "https://user-images.githubusercontent.com/106715328/191583878-0f6c4531-e5f9-4ccc-b575-a954e0f777c7.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191583876-97999110-bcc7-4849-8c3e-977051664a6e.jpg", description: "The Atlantic Princess ship wreck provides an excellent dive for both beginner and experienced divers. The wreck provides many nooks and crannies with an abundance of marine life.")
ds25 = DiveSite.create(name: "Viva Shallow", country: "Dominican Republic", rating: 5, avg_depth: 15, diver_skill_level: "Novice", image_url: "https://user-images.githubusercontent.com/106715328/191586237-96286d9c-5028-4d6d-984d-73904765c669.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191583876-97999110-bcc7-4849-8c3e-977051664a6e.jpg", description: "Full of marine biodiversity, this site is excellent for photographing various marine life species.")
ds26 = DiveSite.create(name: "Buccaneer", country: "Grenada", rating: 3, avg_depth: 24, diver_skill_level: "Advanced", image_url: "https://user-images.githubusercontent.com/106715328/191588227-54818fa6-0213-4d1d-bea1-1688e1ed1e4c.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191586904-e109e155-4985-4925-a780-7a0864dd7ee3.jpg", description: "This ship wreck is a former sloop that is a short swim from Moliniere Reef. Large, tubular coral are specled throughout the wreck with a curious octopus that has called the wreck home.")
ds27 = DiveSite.create(name: "MV Veronica", country: "Grenada", rating: 4, avg_depth: 14, diver_skill_level: "Intermediate",image_url: "https://user-images.githubusercontent.com/106715328/191588315-0a69cc8f-ec3e-44cc-95ea-2055f835e99d.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191586904-e109e155-4985-4925-a780-7a0864dd7ee3.jpg", description: "This ship sunk back in 2001. The bridge, captain's quarters, and engine room are still in tact and allow for an experienced diver to view the wreck.")
ds28 = DiveSite.create(name: "Bianca C", country: "Grenada", rating: 5, avg_depth: 35, diver_skill_level: "Advanced", image_url: "https://user-images.githubusercontent.com/106715328/191592402-33a33130-0290-4f9a-91f2-1ab608eed462.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191586904-e109e155-4985-4925-a780-7a0864dd7ee3.jpg", description: "This ship sunk back in 1961. It is known as the 'Titanic of the Caribbean' due to its sheer size. It has been listed as one of the top 10 dive sites in the world. The ability to dive into one of its upper deck swimming pools is a particular highlight. This dive is foe advanced divers only!")
ds29 = DiveSite.create(name: "Rose Hall Reef", country: "Jamaica", rating: 4, avg_depth: 10, diver_skill_level: "Novice", image_url: "https://user-images.githubusercontent.com/106715328/191599359-2f92b23c-0f73-4c34-a32e-338ccb72875b.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191592841-74a768ab-997f-45b4-89f6-fc4365220318.jpg", description: "At this scuba dive sites location you will discover 'Fairy Castle', a massive colony of pillar coral, and 'Fairy Bridge', a coral formation that connects two sections of reef over a sandy 'river'. The reef forms an intricate system of tunnels that are home to squirrelfish, goatfish, porcupinefish, bar jacks and grunts.")
ds30 = DiveSite.create(name: "Spanish Anchor", country: "Jamaica", rating: 5, avg_depth: 22, diver_skill_level: "Advanced", image_url: "https://user-images.githubusercontent.com/106715328/191599360-c014f0e1-89f7-4906-bbde-853689dfeca4.jpg", country_flag:"https://user-images.githubusercontent.com/106715328/191592841-74a768ab-997f-45b4-89f6-fc4365220318.jpg", description: "A single tank dive, to this site is not enough for hard core diver, there are so much going on, a busy home for parrot fish, sergeant major and grunt. The formation of the sheet carol created some swim through. Wall with cavern and also consists of 2 old Spanish anchors, which are ideal for advanced divers.")
